import React from "react";

import Home from "views/Home"
import Profile from "views/Profile"

export default function Landing(){
  var page = localStorage.getItem("getActivePageName");
  if(page == null){
    return (<><Home /></>);
  }
  if(page == "RegisterPage"){
    return (<><Profile /></>);
  }
  return (<></>);  
}
